import React, { Component } from 'react';


class Footer extends Component {


    render() { 
        var footerStyle = {
            marginBottom: '0',
            marginTop: '20rem',
            outlineStyle: "solid"   
        }

        return (
        <div className="container" style={footerStyle}>

            <div className="row">
                <div className="column column-33">< div className="button button-outline">Calculator</div></div>
                <div className="column column-33"><button button-outline>Data</button></div>
            </div>

        </div>
            );
    }
}
 
export default Footer;
